INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 2834, "青空の下で謁見", 0, "フリーマーケット会場", 10118, 7, "ペコリーヌとの出会い", 2, 8, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 2835, "未来の騎空団\nマスコット？", 0, "フリーマーケット会場", 10118, 7, "マホとの出会い", 2, 8, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 2837, "お嬢さまからの\n緊急依頼", 0, "ランドソル市街地", 10118, 7, "アキノとの出会い", 2, 8, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 4108402, "黄金色の悩みごと", 0, "フリーマーケット会場", 10118, 18, "ジュンとの出会い", 2, 8, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 4107402, "白熱！　格闘大会！", 0, "フリーマーケット会場", 10118, 18, "カオリとの出会い", 2, 8, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 9000227, "祭り太鼓はオーエドの華", 1, "オーエド町", 10118, 16, "ニノンとの出会い", 2, 8, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 2101181, "人気者は遅れて\nやってくる", 0, "フリーマーケット会場", 10118, 19, "スズナとの出会い", 3, 8, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 4109402, "巫女・ミーツ・魔法少女", 0, "ランドソル市街地", 10118, 18, "ナナカとの出会い", 3, 8, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 4305402, "ネズ耳は二度なくなる", 0, "フリーマーケット会場", 10118, 18, "キャル＆コッコロとの出会い", 3, 8, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 4101402, "この出会いにカンパイ！", 0, "ランドソル市街地", 10118, 18, "ユカリとの出会い", 3, 8, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 4106402, "陰陽アンサンブル", 0, "ランドソル市街地", 10118, 18, "アオイとの出会い", 3, 8, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (91002, 1, 2836, "運試し十番勝負！", 1, "フリーマーケット会場", 10118, 7, "シノブとの出会い", 3, 8, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 20063115, 40);
INSERT INTO `v1_58b4d54c0944048acc68b315fbb9570b7ad53bfe68cd4672b30b7e929c8dcb63` VALUES (0, 0, 0, "彼女たちの新たな日常", 0, 0, 10118, 0, "オープニング", 1, 0, 5118600, 0, 20063115, 0);
